INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'hello', 0, 1, 1, 'und', 0, 'One of the main things that will effect the performance of your Drupal site is bloat. There are many modules available, and you may want to install them all, but don’t. Plan ahead, look at what each modules does, try see how well they work and if they offer what you want. Most modules offer an ‘uninstall’ function, but not all do, so when testing a module try it on a dev environment so you can delete it all and start again if needed. This will prevent data in the database that is not needed.', '', 'plain_text'),
('node', 'hello', 0, 2, 2, 'und', 0, 'Updates to Drupal core and contributed modules are released very often, these updates can sometimes include performance improvements, so keeping them up to date is vital. Clearly updates need to carry some level of caution, testing these updates before pushing them live is always a must as you never know what features could have changed, been removed or broken.', '', 'plain_text'),
('node', 'hello', 0, 3, 3, 'und', 0, 'test body', '', 'plain_text'),
('node', 'world', 0, 4, 4, 'und', 0, 'body world 1', '', 'plain_text');
